import React from 'react';
import Modal from '../Modal';


class Create extends React.Component{

  render(){
    return(
      <Modal
          title="Delete Stream"
          content="Hello"
          actions="Goodbye"
          onDismiss={() => history.push('/blog')}
      />
    );
  };
}

export default Create;
